/// tooltip para mostrar el contenido de la celda, si éste no cabe en la celda (elipsized)

 public void setTooltipContenidoEllipsizeTableCellCellFactory(TableColumn tc,  final Object[] args) {
	tc.setCellFactory(col -> new TableCell<Object, String>()
{
    @Override
    protected void updateItem(final String item, final boolean empty)
    {
        super.updateItem(item, empty);
        setText(item);
        TableColumn tableCol = (TableColumn) col;

        if (item != null && tableCol.getWidth() < new Text(item + "  ").getLayoutBounds().getWidth())
        {
		
			 Tooltip t = new Tooltip(item);
 			t.setStyle("-fx-background-color: LIGHTYELLOW; -fx-text-fill: BLACK; -fx-font-size: 18;");
		
            
			//tooltipProperty().bind(Bindings.when(Bindings.or(emptyProperty(), itemProperty().isNull())).then((Tooltip) null).otherwise(new Tooltip(item)));
			tooltipProperty().bind(Bindings.when(Bindings.or(emptyProperty(), itemProperty().isNull())).then((Tooltip) null).otherwise(t));
        } else
        {
            tooltipProperty().bind(Bindings.when(Bindings.or(emptyProperty(), itemProperty().isNull())).then((Tooltip) null).otherwise((Tooltip) null));
        }

    }
});
}

