//formato CONDICIONAL  (usar sub AsignarCellFactoryColumnaNumericoMenorIgualMayorColorFondoColorTexto)
public void setFormatoColumnaNumericoMenorIgualMayorColorFondoColorTexto(TableColumn tc,  final Object[] args)  throws Exception {
    tc.setCellFactory(new Callback<TableColumn, TableCell>() {
        @Override
        public TableCell call(TableColumn param) {
            return new TableCell<Object, Object>() {
                @Override
                public void updateItem(Object item, boolean empty) {
                    super.updateItem(item, empty);
                    if (!isEmpty()){
					
						String Condicion=new String("");
						
						if (item instanceof Float) {
							//System.out.println("ITEM FLOAT");
							//if((float)item<(float) args[0]) {Condicion="Menor";}
							if(((Number) item).floatValue()<((Number) args[0]).floatValue()) {Condicion="Menor";}
							//else if((float)item==(float) args[0]) {Condicion="Igual";}
							else if(((Number) item).floatValue()==((Number) args[0]).floatValue()) {Condicion="Igual";}
							//else if((float)item>(float) args[0]) {Condicion="Mayor";}
							else if(((Number) item).floatValue()>((Number) args[0]).floatValue()) {Condicion="Mayor";}
							//System.out.println("Condicion "+Condicion);
						}
						
						else if (item instanceof Double) {
							//System.out.println("ITEM DOUBLE");
							//if((double)item<(double) args[0]) {Condicion="Menor";}
							if(((Number) item).doubleValue()<((Number) args[0]).doubleValue()) {Condicion="Menor";}
							//else if((double)item==(double) args[0]) {Condicion="Igual";}
							else if(((Number) item).doubleValue()==((Number) args[0]).doubleValue()) {Condicion="Igual";}
							//else if((double)item>(double) args[0]) {Condicion="Mayor";}
							else if(((Number) item).doubleValue()>((Number) args[0]).doubleValue()) {Condicion="Mayor";}
							//System.out.println("Condicion "+Condicion);
						}
						
						else if (item instanceof Long) {
							//System.out.println("ITEM LONG");
							//if((long)item<(long) args[0]) {Condicion="Menor";}
							if(((Number) item).longValue()<((Number) args[0]).longValue()) {Condicion="Menor";}
							//else if((long)item==(long) args[0]) {Condicion="Igual";}
							else if(((Number) item).longValue()==((Number) args[0]).longValue()) {Condicion="Igual";}
							//else if((long)item>(long) args[0]) {Condicion="Mayor";}
							else if(((Number) item).longValue()>((Number) args[0]).longValue()) {Condicion="Mayor";}
							//System.out.println("Condicion "+Condicion);
						}
						
						else if (item instanceof Integer) {
						 	//System.out.println("ITEM INTEGER");
							//if((int)item<(int)args[0]) {Condicion="Menor";}
							//else if((int)item==(int)args[0]) {Condicion="Igual";}
							//else if((int)item>(int)args[0]) {Condicion="Mayor";}
							
							//if((int)item<(int) args[0]) {Condicion="Menor";}
							if(((Number) item).intValue()<((Number) args[0]).intValue()) {Condicion="Menor";}
							//else if((int)item==(int) args[0]) {Condicion="Igual";}
							else if(((Number) item).intValue()==((Number) args[0]).intValue()) {Condicion="Igual";}
							//else if((int)item>(int) args[0]) {Condicion="Mayor";}
							else if(((Number) item).intValue()>((Number) args[0]).intValue()) {Condicion="Mayor";}
							//System.out.println("Condicion "+Condicion);
							
						}

						
						else {
		          			setText(null);
	              			//setTextFill(null);
							setStyle(null);
	              			return;
	 					}
						
						String sColorF=new String("");
						String sColorT=new String("");
						String hexColorF=new String("");
						String hexColorT=new String("");
						
						double[] ColorFondoMenorRGBA=(double[])args[1];
						double[] ColorTextoMenorRGBA=(double[])args[2];
						double[] ColorFondoIgualRGBA=(double[])args[3];
						double[] ColorTextoIgualRGBA=(double[])args[4];
						double[] ColorFondoMayorRGBA=(double[])args[5];
						double[] ColorTextoMayorRGBA=(double[])args[6];
						
						int RColorFondoMenor=(int)ColorFondoMenorRGBA[0];
						int GColorFondoMenor=(int)ColorFondoMenorRGBA[1];
						int BColorFondoMenor=(int)ColorFondoMenorRGBA[2];
						double AColorFondoMenor=ColorFondoMenorRGBA[3];
						
						int RColorTextoMenor=(int)ColorTextoMenorRGBA[0];
						int GColorTextoMenor=(int)ColorTextoMenorRGBA[1];
						int BColorTextoMenor=(int)ColorTextoMenorRGBA[2];
						double AColorTextoMenor=ColorTextoMenorRGBA[3];
						
						int RColorFondoIgual=(int)ColorFondoIgualRGBA[0];
						int GColorFondoIgual=(int)ColorFondoIgualRGBA[1];
						int BColorFondoIgual=(int)ColorFondoIgualRGBA[2];
						double AColorFondoIgual=ColorFondoIgualRGBA[3];
						
						int RColorTextoIgual=(int)ColorTextoIgualRGBA[0];
						int GColorTextoIgual=(int)ColorTextoIgualRGBA[1];
						int BColorTextoIgual=(int)ColorTextoIgualRGBA[2];
						double AColorTextoIgual=ColorTextoIgualRGBA[3];
						
						int RColorFondoMayor=(int)ColorFondoMayorRGBA[0];
						int GColorFondoMayor=(int)ColorFondoMayorRGBA[1];
						int BColorFondoMayor=(int)ColorFondoMayorRGBA[2];
						double AColorFondoMayor=ColorFondoMayorRGBA[3];
						
						int RColorTextoMayor=(int)ColorTextoMayorRGBA[0];
						int GColorTextoMayor=(int)ColorTextoMayorRGBA[1];
						int BColorTextoMayor=(int)ColorTextoMayorRGBA[2];
						double AColorTextoMayor=ColorTextoMayorRGBA[3];
						
						Color colorF=new Color(0,0,0,0);
						Color colorT=new Color(0,0,0,0);
						
						//System.out.println("ANTES DE SWITCH");
						switch(Condicion){
							case "Menor":{
								colorF = Color.rgb(RColorFondoMenor,GColorFondoMenor,BColorFondoMenor,AColorFondoMenor);
								colorT = Color.rgb(RColorTextoMenor,GColorTextoMenor,BColorTextoMenor,AColorTextoMenor);
								break;}
							
							case "Igual":{
								colorF = Color.rgb(RColorFondoIgual,GColorFondoIgual,BColorFondoIgual,AColorFondoIgual);
								colorT = Color.rgb(RColorTextoIgual,GColorTextoIgual,BColorTextoIgual,AColorTextoIgual);
								break;}
							
							case "Mayor":{
								colorF = Color.rgb(RColorFondoMayor,GColorFondoMayor,BColorFondoMayor,AColorFondoMayor);
								colorT = Color.rgb(RColorTextoMayor,GColorTextoMayor,BColorTextoMayor,AColorTextoMayor);
								break;}
							}						

						 hexColorF = toHexString(colorF);
						 hexColorT = toHexString(colorT);
						 
						  setStyle("-fx-text-fill:" + hexColorT +";-fx-background-color: " + hexColorF + ";-fx-background-insets: 0.5 0.5 0.5 0.5 ;");
						setAlignment(Pos.CENTER);

       					setText(""+item);
					}
	 				else {
	          			setText(null);
              			//setTextFill(null);
						setStyle(null);
              			return;
	 				}
                }
            };
        }
    });
}




