public void setFormatoColumnaTipoTextoValoresFondoTextoBorde(TableColumn tc,  final Object[] args)  throws Exception {

	System.out.println("Arrays.toString(args) " + Arrays.toString(args));
	
	String[] ValoresCondicionesTexto = (String[])args[0];
	//String.valueOf(args[0])
	for (String ValorCondicionTexto : ValoresCondicionesTexto) {
		System.out.println("ValorCondicionTexto" + ValorCondicionTexto);	
	}
	
	Object[][] FormatosFondoTextoBorde = (Object[][])args[1];
	Object[] Formato0=FormatosFondoTextoBorde[0];
	int NumeroDeFormatos = FormatosFondoTextoBorde.length;
    int NumeroParametrosFormatos = Formato0.length; 
	
	// Prints array elements row by row
	String rowString = "";
	for(int x = 0; x < NumeroDeFormatos; x++){     // x is the column's index
	    for(int y = 0; y < NumeroParametrosFormatos; y++){ // y is the row's index
	        rowString += FormatosFondoTextoBorde[x][y];
	    }
		System.out.println(rowString);
	}

    tc.setCellFactory(new Callback<TableColumn, TableCell>() {
        @Override
        public TableCell call(TableColumn param) {
            return new TableCell<Object, Object>() {
                @Override
                public void updateItem(Object item, boolean empty) {
                    super.updateItem(item, empty);

					int iDxValCond=-1;
                    if (!isEmpty()){
						String ValorStrCelda=(String)item;
						for (int i = 0; i < ValoresCondicionesTexto.length; i++) {
							if (ValorStrCelda.equalsIgnoreCase(ValoresCondicionesTexto[i])){
								System.out.println("ValorStrCelda " + ValorStrCelda);
								iDxValCond=i;
								
								break;
							}
					 	}
						
						System.out.println("iDxValCond " + iDxValCond);
						
						String hexColorF=new String("");
						String hexColorT=new String("");
						
						Color colorF=new Color(0,0,0,0);
						Color colorT=new Color(0,0,0,0);
						
						if (iDxValCond==-1){  // el valor de la celda no está entre los posibles valores definidos como condiciones para el formato	
							colorF = (Color) FormatosFondoTextoBorde[0][0];
							colorT = (Color) FormatosFondoTextoBorde[0][1];
						}
						else {
							colorF = (Color) FormatosFondoTextoBorde[iDxValCond+1][0];
							colorT = (Color) FormatosFondoTextoBorde[iDxValCond+1][1];
						}
					
						 hexColorF = toHexString(colorF);
						 hexColorT = toHexString(colorT);
						 
						 setStyle("-fx-text-fill:" + hexColorT +";-fx-background-color: " + hexColorF + ";-fx-background-insets: 0.5 0.5 0.5 0.5 ;-fx-wrap-text:false;-fx-alignment:center;");
						//setAlignment(Pos.CENTER);

       					setText(""+item);
					}
	 				else {
	          			setText(null);
              			//setTextFill(null);
						setStyle(null);
              			return;
	 				}
                }
            };
        }
    });
}

